tables.table_schema:
CREATE TABLE GentrificationImpact (
  city_id INT,
  city_name VARCHAR(255),
  median_house_price DECIMAL(10,2),
  gentrification_factor FLOAT
);

CREATE TABLE gentrification_trends (
    trend_id INT PRIMARY KEY,
    city VARCHAR(50),
    trend_year INT,
    trend_description TEXT
);

CREATE TABLE housing_prices (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    year INT,
    avg_price DECIMAL(10, 2)
);

CREATE TABLE gentrification_data (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    year INT,
    gentrification_score DECIMAL(5, 2)
);

CREATE TABLE demographic_data (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    year INT,
    population INT
);

CREATE TABLE urban_areas (
    area_id INT PRIMARY KEY,
    area_name VARCHAR(100) NOT NULL,
    city_name VARCHAR(100) NOT NULL,
    gentrification_status VARCHAR(50) NOT NULL
);

CREATE TABLE demographics (
    area_id INT PRIMARY KEY,
    total_population INT NOT NULL,
    median_income DECIMAL(10, 2) NOT NULL,
    median_age INT
);
